description:
A great re-telling of the first years of the original X-Men, featuring the growing pains of Jean Grey and the guys - Iceman, Beast, Cyclops and Angel - and of course Professor X as well. The story shows off the initial encounters with Magneto and the Brotherhood as well as some brief appearances by other minor and notable characters. A fun and fast read, with some good depth to flesh out the characterizations.

This is the new digital edition of the TPB by Zone-Empire. Thanks to them for their efforts, please seed and enjoy!

